	return (
		<div className="contact__container">
			<div className="title">
				<h1>Contact me</h1>
			</div>
			<div className="title_up">
				<h1>Don't hesitate to contact me</h1>
			</div>
			<div className="my_info">
				<div className="me">
					<img src="" alt="" />
				</div>
				<div className="address"></div>
			</div>
			<div className="email"></div>
		</div>
	);
}
